import React from "react";
import styled from "styled-components";

const LeftbarPositioner = styled.div`
  width: 7rem;
  height: 100vh;
  border-style: solid;
`;

function Sidebar() {
  return <LeftbarPositioner />;
}

export default Sidebar;
